class SndContactSyncListModel {

  SndContactSyncListModel({
      this.message, 
      this.data,});

  SndContactSyncListModel.fromJson(dynamic json) {
    message = json['message'];
    if (json['data'] != null) {
      data = [];
      json['data'].forEach((v) {
        data?.add(SecondContactSyncList.fromJson(v));
      });
    }
  }
  String? message;
  List<SecondContactSyncList>? data;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['message'] = message;
    if (data != null) {
      map['data'] = data?.map((v) => v.toJson()).toList();
    }
    return map;
  }

}

